import React, { useState } from 'react'
import Palette from './Palette'
import OptionsCreo from './OptionsCreo'

function Creo() {
  const [color, setColor] = useState()

  return(
    <div>
      <p>{ color }</p>
      <Palette />
      <OptionsCreo />
    </div>
  )
}

export default Creo;
